import React, { Component } from "react";
import axios from "axios";
import NavbarRR from './components/navbar'
import Month from './components/month'

class App extends Component {
  state = {
    data: [],
  };
  render() {
    return (
      <React.Fragment>
        <NavbarRR />
        <Month />
      </React.Fragment>
    );
  }
}

export default App;
